INSERT INTO `article` (`id`, `content`, `date`, `title`, `author_id`) VALUES
(10, 'Rok 2019 byl splněným snem nejednoho hudebního fanouška. Do České republiky měsíc co měsíc zavítala jedna hvězda za druhou. Nechyběl třeba spoluzakladatel legendární kapely Pink <b>Floyd Roger Waters</b> či asi nejznámější bubeník na světě, „brouk“ <b>Ringo Starr</b>. Leckdo by řekl, že takovou hudební nadílku asi jen tak něco netrumfne. Opak je pravdou.\r\n<br>\r\n<br>\r\nPořadatelé hudebních akcí nezahálí, a proto se i letošní rok ponese v duchu zvučných jmen i mladých talentů, kteří si už teď podmanili značnou část hudebního světa. Pokud se ale v té smršti oznámených interpretů, která vám za poslední měsíce vyskakovala na Instagramu i Facebooku, ztrácíte, určitě vám pomůže náš seznam, ve kterém jsme vybrali koncerty, které byste si neměli rozhodně nechat ujít. Kdo bude váš favorit?\r\n<br>\r\n<br>\r\n<b>Aminé</b> - Čtyřiadvacetiletý americké raper známý především díky hitu Caroline si v únoru odbude svoji pražskou premiéru. Do známého klubu v Dlouhé ulici doveze jak svůj debut Good for You, tak počin Onepointfive, který označuje jako EP/LP/mixtape/album. Lístky mizí rychle, tak se nerozmýšlejte dlouho!\r\n<br>\r\n<br>\r\n<b>Algiers</b> - Experimentální post-punková formace z amerického státu Georgia vloni zazářila na svém koncertě v rámci Colours of Ostrava. Jejich skladby se vám zaryjí hluboko pod kůži a jen tak se nepustí. Témata týkající se brexitu, Donalda Trumpa i společenského dění vkládá tohle trio do originální směsice punku, rocku, new wave a gospelu. Husí kůže a spadlá brada zaručeny!\r\n<br><br>\r\n<b>Kimbra</b>- Pamatujete si na zpěvačku, která před několika lety nazpívala společně se zpěvákem Gotye megahit Somebody I Used To Know? To je dobře. Tahle novozélandská hudebnice totiž není žádný „one hit wonder“, ale držitelka dvou cen Grammy. Své poslední vydané EP s názvem Songs from Primal Heart, Reimagined zasvětila akustickým verzím svých písní a podobné aranžmá předvede i na svém pražském koncertu. Výrazný zpěv doplní kytara, klavír a kontrabas. Že by další niterní večer?\r\n<br><br>\r\n<b>Ariana Grande</b> - Novodobou pětadvacetiletou popovou princeznu čeká letos v Praze premiéra. Na koncertě představí především svoji nejnovější desku Sweetener společně s hitem thank u, next či God is a woman. Její vystoupení jsou mladistvou oslavou popu a soulu s prvky hip hopu, které lákají především generace teenagerů. My v redakci hlavně pevně doufáme, že Arianiny koncerty budou fanouškům nosit už jen samou radost a po neskutečně smutných událostech z roku 2017 zbude už jen vzpomínka.\r\n<br><br>\r\n<b>Metallica</b> - Teprve nedávno nás přestaly sociální sítě krmit stovkami záznamů z loňského koncertu z pražské O2 areny, kdy tito králové metalu zahráli Jožina z bažin. Nevíme, co si pro české publikum připraví letos za pikantnost. Spekulovat ale teď nemá cenu, pojďme si raději zopakovat texty ke klasikám, jako je Enter Sandman či Master of Puppets. Ty totiž společně s peckami z posledního alba Hardwired To Self Destruct zazní na rozdíl od Mládkova Jožina určitě.\r\n<br><br>\r\n<b>Florence + The Machine</b> - Pokud bude přeci jen temnota The Cure na vás až moc, náladu si budete moct spravit na snové Florence + The Machine. Tahle nadpozemská zpěvačka a skladatelka společně se svojí kapelou zajisté promění celé Colours v jednu velkou oslavu éteričnosti. Žánrově je tuto anglickou formaci složité zařadit, kombinuje prvky poprocku, art rocku s alternativou protkanou instrumenty, jako je harfa či varhany. Jestli jste nestihli lednový koncert víly Aurory, koncert víly Florence musíte už stihnout na 100 %!\r\n<br><br>\r\n<b>Slipknot</b> - Nasaďte masky, začínáme! Uskupení o devíti členech asi není třeba představovat. Metalová nálož plná excentrismu a nihilismu zahraje v O2 areně po třech letech a už teď jsme zvědaví, jestli se i letos dočká publikum dalších velice příjemných projekcí ukazující například operace na lidském těle. Vive la naturalismus!\r\n<br><br>\r\n<b>Rammstein</b> - Němečtí představitelé žánru označovaného jako Neue Deutsche Härte, se vrací na místo činu, kde vloni dva květnové dny proměnily v jednu velkou, pyrotechnikou nabušenou industriální party.  Letošní koncert možná bude ještě o něco pestřejší, protože tahle ikonická skupina chystá po deseti letech novou studiovou desku. O hity i novinky tak určitě nebude nouze. \r\n', '2020-04-18', 'Slipknot, Ariana Grande nebo Rammstein. Které koncerty v Česku letos musíte navštívit?', 24),
(11, 'Hudba by měla lidi spojovat a ne rozdělovat. Obzvláště v období, kdy celý svět bojuje s koronavirem, který nám překazil všechny plány na nejbližší týdny. Interpreti nás sice každý den zásobují novými skladbami, videoklipy či alby, jejichž vydání měli s vydavatelstvími naplánováno už delší dobu, podobně si ale dlouhé chvíle můžeme zpříjemňovat sestavováním žebříčků.\r\n<br><br>\r\nV rámci dnešního článku si tak představíme<b> 5 nejlepších raperů s přívlastkem „Lil“ před jménem.</b> Na scéně jich sice najdeme stovky, avšak jen nízké procento se dokáže plnohodnotně prosadit a vybudovat si kariéru lemovanou řadou úspěchů. Nyní se už ale přesuneme k samotným interpretům, přičemž věříme, že na své si přijdou zastánci staré i nové školy. \r\n<br><br>\r\n<b>Lil Durk</b> - 27letý rodák z Chicaga se na scéně pohybuje přibližně od roku 2015. Za tu dobu stihl v rámci své kariéry zaznamenat několik úspěchů, ale i pádů, včetně problémů s vydavatelstvím Def Jam či beefu s Chief Keefem.\r\n<br><br>\r\n<b>Lil Pump</b> - Gazzy Garcia, známý také jako Lil Pump, je americký rapper a textař. Proslul svým singlem „Gucci Gang“, který se dostal na 3. příčku v žebříčku Billboard Hot 100. Za tuto píseň také získal platinovou certifikaci. Své debutové album Lil Pump vydal 6. října 2017.\r\n<br><br>\r\n<b>Lil Peep</b> - Lil Peep, vlastním jménem Gustav Elijah Åhr, byl americký rapper a skladatel. Byl známý pro svůj styl emo. Ve svých textech se zabýval depresemi, drogami, milostnými vztahy z minulosti a sociálními problémy.\r\n<br><br>\r\n<b>Lil Wayne</b> - Dwayne Michael Carter, Jr. , lépe známý pod pseudonymem Lil\' Wayne, je americký rapper a zakladatel labelu Young Money Entertainment. V devíti letech se upsal labelu Cash Money Records, kde účinkoval ve skupině The B.G.\'z.Ve svých patnácti letech zakládá kapelu Hot Boys, kde se objevují další členové - Juvenile, Turk a B.G, přičemž Dwayne je nejmladší. Jejich debut Get It How U Live! se dostává na první příčku mezi Top R&B/Hip-Hop Album v časopise Billboard. Je pětinásobným držitelem prestižní ceny Grammy.\r\n<br><br>\r\n<b>Lil Dicky</b> - David Andrew Burd, známější jako Lil Dicky nebo LD, je americký rapper a komik. Do povědomí lidí vstoupil singlem „Ex-Boyfriend“, který se stal virálním a během 24 hodin získal na YouTube více než milion zhlédnutí. Debutové album Professional Rapper vydal 31. července 2015.\r\n<br>', '2020-04-18', 'Vybrali jsme 5 nejlepších raperů s přívlastkem „Lil“ za poslední dekádu!', 24),
(12, '<h3>Velká scéna, světla, pyrotechnika a efekty. Zkrátka set se vším všudy!</h3>\r\n<p>V sobotu 18. dubna 2020 od 20.00 hodin proběhne speciální livestreamový koncert skupiny Rybičky 48. <i>„Zachraňovat životy sice neumíme, ale rádi bychom pomohli tím, co umíme nejlíp. A vy můžete pomáhat s námi! Dohodli jsme se na uspořádání tohoto koncertu, protože nechceme jen sedět a čekat, až to celé přejde,\" </i>říkají členové kapely Rybičky 48 jako jeden muž. Cílem koncertu Rybičky 48 Corontena Show Live je získat finanční prostředky a pomoci tam, kde je to teď nejvíc potřeba. V souladu se stávajícími bezpečnostními a hygienickými opatřeními se koncert uskuteční bez publika, s minimálním počtem technického a pomocného personálu.</p>\r\n<p><i>„Aktuálně cítíme, že mezi nejohroženější patří senioři žijící v různých domovech důchodců a podobných zařízeních. Proto jsme spojili síly s Českým červeným křížem, který celý výtěžek koncertu využije na pořízení ochranných pomůcek a dalšího nezbytného vybavení pro domovy seniorů, domovy se zvláštním režimem a také pro svých čtrnáct agentur Domácí ošetřovatelské péče Alice,\" shrnuje Kuba Ryba. „Nápad Rybiček 48 na uspořádání koncertu pro dobrou věc nás ohromně nadchl a za finanční dar předem děkujeme. Ještě větší radost mám z toho, že se kluci rozhodli podpořit právě seniory, jejichž současná situace je opravdu nelehká, stejně jako situace našeho odborného personálu, který se o ně stará. Víme, že za Rybičky 48 někdo jiný koncert nezahraje. Protože \"Někdo jiný” neexistuje. Pomoc druhým i sobě je na nás,\"</i><b> říká Miroslava Jirůtková z Českého červeného kříže</b>, jehož mottem je „Už sto let nečekáme až pomůže někdo jiný\". </p>\r\n<p>Rybičky 48 mají ještě jeden důvod, proč uskuteční tento koncert. <i>„Náš bubeník Ondra Štorek více než deset let pracoval v pečovatelské službě, a tak si dobře uvědomujeme, jak je tato práce náročná a nesmírně důležitá. Budeme rádi, když spolu s námi pomůžete těm, kdo jsou v těchto dnech nejzranitelnější a naši společnou pomoc skutečně potřebují,\"</i> vyzývá za celou skupinu kytarista Petr Lebeda. Rybičky 48 odehrají tento koncert zadarmo a veškerý čistý zisk bude poukázán Českému červenému kříži. <i>„Budeme rádi, když se připojíte a pozvete i své přátele. My vám za to pošleme pořádný kus energie, kterou nám dáváte při koncertech. Všichni se v myšlenkách vrátíme do normálního světa a navíc společně pomůžeme sakra dobré věci,\"</i>říká kapela Rybičky 48.</p>', '2020-04-11', 'Rybičky 48 odehrají speciální livestreamový koncert Corontena Show Live', 24),
(13, '<p>V téhle složité době je člověk vděčný za každou dobrou zprávu. O to hůř se snáší zprávy o úmrtí muzikantů. Zvlášť, když přijdou zničehonic, jako ta včerejší o náhlém úmrtí kontrabasisty, zpěváka a textaře <b>Dušana Vančury</b>. Klíčový člen <b>Spirituál kvintetu</b> odešel v 82letech.</p>\r\n<p>Původním povoláním inženýr-elektrikář, Vančura byl také hudebním aranžérem a překladatelem, Ve Spirituál kvintetu působil od roku 1969 až do své smrti. V Chlumu u Třeboně vedl dětský sbor Sejkorky. Se svou ženou Zuzanou, Magdalenou Jungwirthovou a Štěpánem Štruplem obnovil svůj vokální soubor Antikvartet, který zpíval mimo jiné i některé staré písničky Spirituál kvintetu.</p>\r\n<p>\r\nVančura zemřel na zánět zubu. V souvislosti s probíhající pandemií koronaviru raději nešel k lékaři, zánět se rozšířil, což vedlo k sepsi, která se mu stala osudnou.\r\nJe až ironie, že se vše přihodilo v době, kdy měl Spirituál kvintet odehrát své výroční a zároveň poslední koncerty v pražské Lucerně k 60 letům existenci, nakonec přeložené na září 2020. Není pochyb o tom, že Dušan Vančura zůstane ve vzpomínkách všech, kteří ho znali a jeho texty si budou příznivci zpívat ještě dlouhá léta.</p>', '2020-04-05', 'Zemřel kontrabasista a textař Dušan Vančura', 24),
(14, '<p>Soutěž Jazzfruit pod festivalem Mladí ladí jazz už deset let vyhledává zajímavé a nadějné talenty v široké paletě jazzových i jiných stylů a žánrů. Jedenáctý ročník soutěže v reakci na současnou situaci nabídne nový rozměr v podobě otevřené výzvy online světa pro mladé hudebníky. V prvním kole vybere odborná porota, v jejímž čele zasednou Lenka Dusilová a Matěj Ruppert, na základě dodaných předepsaných podkladů shortlist. S osmi nejlepšími pořadatel soutěže natočí profesionální propagační videa, která budou nahrazovat jejich živá vystoupení. V druhém kole na základě těchto videí rozhodne odborná porota společně s fanoušky o postupu do semifinále. Semifinálové i finálové kolo proběhnou LIVE jako streamingová videa, kde vždy vystoupí dvojice kapel. On-line přenosy doplní battly sólových hudebníků, kteří se utkají o ceny z Kytary.cz. Hlasování fanoušků bude probíhat na Facebooku Mladí ladí jazz. Hlavní myšlenkou soutěže je podpořit muzikanty v současné nelehké situaci a zároveň přinést takový formát soutěže, aby byl atraktivní i pro její diváky, kteří budou moci hlasovat on-line.</p>\r\n\r\n<p>Nový průběh soutěže Jazzfruit letos zve pouze české kapely a hlásí další novinky: „Letos posunujeme věkovou hranici muzikantů účinkujících na 35 let, myslíme si totiž, že mládí ve třiceti ještě nekončí,” říká za organizátory s úsměvem Jan Gregar s odkazem na věkovou hranici z minulých let, a dodává: „Nově také spolupracujeme s Českými centry. Jednou z hlavních cen je Cena Českých center, které poskytnou rezidenční pobyt v Paříži a zajištění dvou dalších zahraničních koncertů.” Výherce druhého místa získá hodnotné ceny od <a href=\"https://kytary.cz/\" target=\"_blank\">Kytary.cz.</a></p>\r\n\r\n<p>Uzávěrka přihlášek je 30. dubna. Hudebníci, které splňují podmínky soutěže musí poslat nejméně dvě hudební nahrávky a další materiály dle propozic. Všichni semifinalisté dostanou finanční odměnu 3 tisíce korun. Na rozdíl od předchozích let se do soutěže mohou přihlásit i kapely, které v předchozích ročnících Jazzfruit vyhráli. Podmínku české národnosti a věk do 35 let musí splňovat nejméně 75 % kapely.</p>\r\n\r\n<p>Podrobné podmínky soutěže Jazzfruit najdou zájemci <a href=\"http://www.mladiladijazz.cz/jazzfruit\" target=\"_blank\">zde</a></p>\r\n\r\n<p>Festival Mladí ladí jazz pravidelně nabízí koncerty hudebníků, kteří se nebojí bořit zažité jazzové škatulky a otevírají je nejrůznějším hudebním žánrům. Stejně jako všechny kulturní akce plánované na letošní jaro není možné festival realizovat v původním plánovaném termínu. Většina koncertů by se měla uskutečnit v náhradním podzimním termínu. Stejně tak bude přesunuta série interaktivních koncertů Mladí ladí dětem.</p>', '2020-04-18', 'Festival MLADÍ LADÍ JAZZ vyhlašuje speciální korona edici soutěže JAZZFRUIT', 24);

