INSERT INTO `interpret` (`id`, `description`, `name`, `photo`) VALUES
(16, '<p>Rest, vlastním jménem Adam Chlpík (*1986, Trenčín) je český rapper a MC.</p>\r\n\r\n<p>Kromě psaní textů se v minulosti aktivně věnoval freestyle rapu. Cca od roku 2003 byl členem kapely \"DIVNEJ POSTOY\" a od roku 2010 působí v českém <b>labelu Ty Nikdy</b> (společně s Ideou, Pauliem Garandem, MC Geyem, Boy Wonderem, DJem Fattem, Inphym, Kenny Roughem, FNTMem a Dubasem a dalšími). Mimo několika dřívějších vítězství na akcích jako Battle night, Urban Rapublic a mnoha dalších českých battlech, vyhrál v roce 2008 i prestižní Art Attack Freestyle Battle na Slovensku. V roce 2010 vydal s DJem Fattem společnou desku “Premiéra”. Ta zaznamenala obrovský úspěch a nastartovala jeho sólovou kariéru. Skončil s aktivní účastí na battlech a začal se naplno věnovat koncertování a vydávání skladeb. Mezi největší hity tohoto alba patří <b>Balkónovka, Panáky na zem, Premiéra, Kuřivoj Vysajbong</b> atd. V roce 2012 vyšla společná deska celého Ty Nikdy labelu s názvem “Label”. V říjnu 2013 vyšla jeho druhá deska s názvem “Střepy” opět s DJem Fattem a po delší pauze, kdy rozdával sloky na cizí alba víc než vlastní tracky, vyšla v dubnu 2018 konečně jeho třetí deska “Restart”. Nyní už šlo o album s hudbami od více producentů, mezi kterými ale nechyběl ani DJ Fatte. Na albu se v textech silně odráží změny v životě Resta a jeho tvorba i sdělení se posouvá jinam, než na předchozích albech. V říjnu 2018 vyšla druhá společná label deska s názvem “AKTA X”. Nyní Rest pracuje na čtvrté sólo desce.</p>', 'Rest', );
INSERT INTO `interpret` (`id`, `description`, `name`, `photo`) VALUES
(17, '<p>Kabát je česká rocková skupina z Teplic existující od roku 1983 a na hudební scéně aktivně působící od roku 1989. Za svou 30letou kariéru skupina vydala 11 studiových alb, kterých se prodalo přes 1 000 000 kopií, reprezentovala Česko na soutěži Eurovision Song Contest ve Finsku v roce 2007, kde ovšem neuspěla, a v roce 2015 vyhrála desátého slavíka za 1. místo v anketě Český slavík. Návštěvnost jejich vystoupení se pohybuje okolo 20 000 lidí na jeden koncert. Největším úspěchem skupiny bylo výroční vystoupení na pražském Vypichu roku 2014, kam dorazilo přes 70 000 fanoušků. V roce 2014 byla uvedena do Beatové síně slávy rádiem Beat. Od roku 1989 hraje bez personální změny a nikdy od té doby nepřerušila svoji činnost.</p>', 'Kabát', );
INSERT INTO `interpret` (`id`, `description`, `name`, `photo`) VALUES
(18, '<p>Michael Joseph Jackson (29. srpna 1958 Gary, Indiana, USA – 25. června 2009 Los Angeles, Kalifornie, USA) byl americký popový zpěvák, skladatel, choreograf, tanečník, producent a mecenáš afroamerického původu. Zařadil se na třetí místo nejprodávanějších interpretů po skupině The Beatles a zpěvákovi Elvisi Presleym. Jeho desky Thriller (1982), Bad (1987) a Dangerous (1991) patří mezi nejvýznamnější v oblasti pop music. Album Thriller je s výrazným náskokem nejprodávanějším albem všech dob, prodalo se ho 110 milionů kusů.[2] Jackson je označován za Krále popu (King of Pop) a za jednu z nejslavnějších osob hudební historie. Byl zástupcem konvenčního popu a taneční hudby, vycházející ze soulu. Kromě svého charakteristicky vysokého hlasu, rytmického cítění a tanečních schopností byl znám i jako velký perfekcionista. Za svoji kariéru získal celkem 13 cen Grammy a 26 cen American Music Award.</p>\r\n\r\n<p>\r\nMichael Jackson se z devíti sourozenců narodil jako sedmý. Za zahájení jeho kariéry se pokládá rok 1964, když se svými bratry (skupina Jackson 5) vystoupil na pódiu. Sólovou kariéru zahájil v roce 1971, kdy vydal svou první baladu Got To Be There. Tuto píseň přidal v lednu 1972 na stejnojmenné album. Dále Michael vydal alba Ben, Music & Me a Forever, Michael. Tyto alba vydal pod společností Motown.</p>\r\n<p>\r\nPak přišel zlom. Michael Jackson i skupina Jackson 5 už nechtěli vydávat alba pod Motownem. Tak tedy v roce 1976 odešli z této společnosti a přidali se k nahrávací společnosti Epic Records. Tam také skupina Jackson 5 změnila svůj název na The Jacksons, protože Motown tvrdil, že název Jackson 5 je \"jejich\".</p>\r\n<p>\r\nMichael od útlého věku velice trpěl s výchovou svého otce. Má se za to, že jeho otec Joe používal staromódní výchovné metody, tudíž že své děti často bil. Michael se mu také stal terčem posměchu kvůli svému nosu a otec mu začal říkat \"Velký nos\". Jeho matka Katherine tyto metody neschvalovala a svého syna vždy zahrnovala láskou. Michael se vždy přidával na stranu matky. V roce 2007 uvedl, že při domovních zkouškách, které měl před školou i po ní, držel jeho otec v ruce pásek a když někdo ze skupiny Jackson 5 něco pokazil, dostal jím. Na druhou stranu se mu to vyplatilo, protože takhle vytvořil jedinečného Krále popu.</p>', 'Michael Jackson', );
INSERT INTO `interpret` (`id`, `description`, `name`, `photo`) VALUES
(20, 'Jedná se o mladého brněnského rappera, který je původem z<b> Ukrajiny</b>. Má za sebou dvě velice úspěšná alba, 2 roky ve vězení a spoustu dalšího..', 'Michajlov', );
INSERT INTO `interpret` (`id`, `description`, `name`, `photo`) VALUES
(21, '<p>Paulie Garand (vlastním jménem Pavel Harant (* 17. října 1987, Liberec, Československo) je český rapper a producent.</p>\r\n<p>\r\nPo pár letech tvoření hudby do šuplíku se poprvé zapsal do širšího povědomí demem Mozoly (2006). Poté následovala éra s kapelou BPM, se kterou vydal desky Slova (2007) a Horizonty (2009). Poslední jmenovaná navíc získala cenu Akademie populární hudby v kategorii Hip-Hop a RnB. Po komerčním úspěchu obou alb se členové BPM rozhodli fungovat sólo a Paulie se nedlouho na to dostává k vydavatelství Ty Nikdy Label.</p>', 'Paulie Garand', );
INSERT INTO `interpret` (`id`, `description`, `name`, `photo`) VALUES
(22, '<p>Helena Vondráčková (* 24. června 1947 Praha) je česká zpěvačka a herečka, sestra herce a zpěváka Jiřího Vondráčka a teta zpěvačky a herečky Lucie Vondráčkové.</p>\r\n<p>Zlom v kariéře nastal 27. dubna 1964, kdy v paláci Lucerna vyhrála pěveckou soutěž Hledáme nové talenty s písněmi George Gershwina „Summertime“ a „The Man I Love“. Díky hitům „Červená řeka“ (1964) a „Pátá“ se stala Zlatou slavicí za rok 1965 a nastoupila do angažmá v divadle Rokoko. Zde se seznámila s Martou Kubišovou a Václavem Neckářem, s nimiž v roce 1968 vytvořila popové trio Golden Kids. V roce 1967 hrála hlavní roli v pohádce Šíleně smutná princezna, kde ztvárnila postavu princezny Helenky. Film měl premiéru na jaře 1968.</p>', 'Helena Vondráčková', );

