INSERT INTO `music_event` (`id`, `content`, `end_date`, `poster`, `start_date`, `title`, `author_id`) VALUES
(27, '<p>Hip Hop Kemp je mezinárodní hip hopový festival, který se koná každý rok koncem srpna v Hradci Králové, v areálu Festivalparku. Do těchto prostor se přestěhoval z původního místa konání v Pardubicích v areálu koupaliště Cihelna. Jde o jeden z největších hip hopových festivalů v Evropě. Návštěvnost festivalu se pohybuje kolem 20 000 návštěvníků. První ročník se konal v roce 2002.</p>', '2020-08-23', , '2020-08-20', 'HIP HOP KEMP', 24);
INSERT INTO `music_event` (`id`, `content`, `end_date`, `poster`, `start_date`, `title`, `author_id`) VALUES
(28, '<p>Sázavafest je multikulturní, převážně hudební festival pořádaný každý rok v okolí řeky Sázavy. V srpnu 2008 se uskutečnil již osmý ročník. Festival se konal do roku 2006 ve městě Sázava, ale od roku 2007 je pořádán v Kácově. V roce 2011 se přesunul do Benešova. V roce 2013 opět změnil místo pořádání a koná se ve Světlé nad Sázavou.</p>\r\n<p>\r\nPrvní ročník festivalu se uskutečnil v roce 2001 na jediném pódiu. Postupem času se akce rozrostla a na šestém ročníku vystoupilo na sedmi jevištích velké množství známých interpretů české hudební scény a také mnoho zahraničních hostů. Kromě hudební produkce se na Sázavafestu uskutečnily i autorská čtení například Michala Viewegha či Mardoši.</p>\r\n<p>\r\nV roce 2015 se stala hlavním investorem jihlavská společnost XANADU-Catering a festival rozšířil počet vystupujících kapel.</p>', '2020-07-26', , '2020-07-23', 'SÁZAVAFEST', 24);
INSERT INTO `music_event` (`id`, `content`, `end_date`, `poster`, `start_date`, `title`, `author_id`) VALUES
(30, '<p>Votvírák je český letní multižánrový hudební festival zaměřený především na české a slovenské interprety.[1] Koná se každoročně od roku 2007 v červnu na ploše bývalého vojenského letiště Boží Dar ve zrušeném vojenském výcvikovém prostoru Milovice - Mladá.</p>', '2020-06-14', , '2020-06-12', 'VOTVÍRÁK', 24);

